import React, {useState} from 'react';
import dynamic from 'next/dynamic'
const Reactpip = dynamic( () => import('react-picture-in-picture'), {ssr: false}) 

const Video = ({}) => {
  const [active, setActive] = useState(true)

  return (
    <div className="video">
      <div className="video-title">What is SPM?</div>
      <div className="video-subheading">See the Video Below</div>
      <div className="video-player">
        <Reactpip isActive={active} >
          <source src="/media/video.mp4"/>
        </Reactpip> 
        {/* <video src='media/video.mp4' controls/>
        <button id="pipButtonElement"></button> */}
      </div>
    </div>
  )
}

export default Video
